import { NavLink } from "react-router-dom";

import "./Menu.css";

function Menu() {
	return (
		<nav>
			<ul>
				<li>Inicio</li>
				<NavLink
					className={({ isActive }) => (isActive ? "tamoactivo" : "none")}
					to="/personajes"
				>
				Personajes
				</NavLink>
				<li>Productos</li>
			</ul>
		</nav>
	)
}
export default Menu;
